import React from "react";
import { Link } from "react-router-dom";
// import { AuthContext } from "./Auth";
import DashBoard from "./Dashboard";
import "./Student.css";

const Student = () => {
  //   const { currentUser } = useContext(AuthContext);

  return (
    <>
      <header>
        <DashBoard />
      </header>
      <br />
      <div class="container">
        <div className="d-flex justify-content-center mt-3">
          <span className="text text-center">ข้อมูลนักเรียน</span>
        </div>
      </div>
      <Link to="addstu" >
      <div class="d-grid gap-2 d-md-flex justify-content-md-end">
        <button class="btn btn-primary me-md-2 add" type="button">
          Add
        </button>
      </div>
      </Link>

      <div class="container">
        <div class="panel panel-default">
          <div class="panel-heading">
          <h4><Link to="/">Board List</Link></h4>
            <h3 class="panel-title">
              {this.state.students.stuid}
            </h3>
          </div>
          <div class="panel-body">
            <dl>
              <dt>Name:</dt>
              <dd>{this.state.students.stuname}</dd>
              <dt>class:</dt>
              <dd>{this.state.students.rclass}</dd>
            </dl>
            <Link to={`/edit/${this.state.key}`} class="btn btn-success">Edit</Link>&nbsp;
            <button onClick={this.delete.bind(this, this.state.key)} class="btn btn-danger">Delete</button>
          </div>
        </div>
      </div>
    );
  }
    </>
  );
};

export default Student;
